import React, { Component } from 'react';


class App extends Component {
  render() {
    return(
      <div className="container">
        <div className="col-xs-12">
        <h1>My Todos</h1>
          <div className="card">
            <div className="card-body">
              <h5 className="card-title">Usuarios</h5>
            </div>
          </div>
        </div>
       </div>
    )
  }
}

export default App;
